syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";

import "ClientCollectorData.proto";

message ClientCollectorDataNotify {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 4265;
	}

	repeated ClientCollectorData client_collector_data_list = 1;
}
